import styled from "styled-components";
import arrow from "../../images/arrow.svg";

const ProductContainer = styled.div`
  width: 100%;
  margin-top: 20px;
  padding: 30px 0;
  border: 1px solid #3d3d3d;
`;

const ProductInfoColumn = styled.div`
  width: 100%;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`;

const ProductInfo = styled.div`
  width: 100px;
  flex-grow: 1;
`;

const ProductsButton = styled.div`
  width: 80px;
  flex-grow: 0;
  display: flex;
  align-items: center;
`;

const Toggle = styled.img`
  width: 15px;
  height: auto;
`;

const Product = () => {
  return (
    <ProductContainer>
      <ProductInfoColumn>
        <ProductInfo>123</ProductInfo>
        <ProductInfo>123</ProductInfo>
        <ProductInfo>123</ProductInfo>
        <ProductInfo>123</ProductInfo>
        <ProductInfo>123</ProductInfo>
        <ProductsButton>
          <Toggle src={arrow} />
        </ProductsButton>
      </ProductInfoColumn>
    </ProductContainer>
  );
};

export default Product;
